#ffmpeg must be installed for the song to work I think
import pygame, random, base64, io, tempfile, os, subprocess, atexit
screenWidth = 800
screenHeight = 600
BLUE = (0,0,255)
WHITE = (255,255,255)
BLACK = (0,0,0)
FPS = 60
pygame.init()
screen = pygame.display.set_mode([screenWidth, screenHeight],pygame.RESIZABLE)

pygame.display.set_caption("Use WASD or Arrow Keys to Move, Spacebar to slow down (toggle)")


level = 1

clock = pygame.time.Clock()
pygame.mixer.init()
font = pygame.font.SysFont(None, 40)


DOGSONG_B64 = """

"""

def _play_dogsong_from_b64():
    if not DOGSONG_B64:
        return
    try:
        data = base64.b64decode(DOGSONG_B64)

        # Write embedded bytes to a temp .m4a file
        m4a_tmp = tempfile.NamedTemporaryFile(delete=False, suffix='.m4a')
        try:
            m4a_tmp.write(data)
            m4a_tmp.flush()
            m4a_name = m4a_tmp.name
        finally:
            m4a_tmp.close()

        # Prepare wav temp file
        wav_tmp = tempfile.NamedTemporaryFile(delete=False, suffix='.wav')
        wav_name = wav_tmp.name
        wav_tmp.close()

        # Convert to WAV using ffmpeg (primary required path)
        proc = subprocess.run(['ffmpeg', '-y', '-i', m4a_name, wav_name], capture_output=True)
        if proc.returncode != 0:
            stderr = proc.stderr.decode(errors='replace')
            raise RuntimeError(f"ffmpeg conversion failed: {stderr}")

      

        # register wav cleanup once
        if '_embedded_wav_files' not in globals():
            global _embedded_wav_files
            _embedded_wav_files = []
            atexit.register(lambda: [os.remove(p) for p in list(_embedded_wav_files) if os.path.exists(p)])
        _embedded_wav_files.append(wav_name)

        pygame.mixer.music.load(wav_name)
        pygame.mixer.music.play(-1)
    except Exception as e:
        print("Failed to play Dogsong from embedded data:", e)

# Attempt to play embedded Dogsong (no-op if DOGSONG_B64 is empty)
_play_dogsong_from_b64()


# Embedded PNG data (base64). Single-line assignment for easier handling.
player_png_b64 = ""

# Decode and load into a Surface, then scale to desired player size
data = base64.b64decode(player_png_b64)
buf = io.BytesIO(data)
buf.seek(0)
try:
    player_image = pygame.image.load(buf).convert_alpha()
except Exception as e:
    raise RuntimeError(f"Failed to load embedded PNG: {e}") from e
player_image = pygame.transform.scale(player_image, (65, 60)) #first is width, second is height

player = player_image.get_rect()
player.x = 200
player.y = 200
# Toggle to move at half speed when True (spacebar toggles)
half_speed = False

running = True

#Here is a function that will handle inputs
def handleInputs(x,y):
    
    global running
    global half_speed
    keys = pygame.key.get_pressed()#Getting a list of keys that are down each frame
    # Movement amount (half speed toggle)
    move_amt = 10
    if half_speed:
        move_amt = max(1, move_amt // 2)

    if keys[pygame.K_w] or keys[pygame.K_UP]:#These get triggered each frame that your finger is on the key
        y -= move_amt
        print("W or UP key is currently pressed")
    if keys[pygame.K_s] or keys[pygame.K_DOWN]:#These get triggered each frame that your finger is on the key
        y += move_amt
        print("S or DOWN key is currently pressed")
    if keys[pygame.K_a] or keys[pygame.K_LEFT]:#These get triggered each frame that your finger is on the key
        x -= move_amt
        print("A or LEFT key is currently pressed")
    if keys[pygame.K_d] or keys[pygame.K_RIGHT]:#These get triggered each frame that your finger is on the key
        x += move_amt
        print("D or RIGHT key is currently pressed")

    
    for event in pygame.event.get():
        if event.type == pygame.KEYDOWN:#This gets triggered when your finger presses the key
            if event.key == pygame.K_SPACE:
                half_speed = not half_speed
                print(f"Half-speed {'ON' if half_speed else 'OFF'}")
                
        if event.type == pygame.KEYUP:#This only gets triggered when your finger lifts off of the key
            if event.key == pygame.K_ESCAPE:
                print("Escape key up, exiting.")
                running = False

        
        if event.type == pygame.MOUSEBUTTONDOWN:
            print(f"Mouse button {event.button} clicked at {event.pos}")
        if event.type == pygame.QUIT:
            running = False
    # Clamp position so player cannot move off the visible screen
    pw = player_image.get_width()
    ph = player_image.get_height()
    max_x = screen.get_width() - pw
    max_y = screen.get_height() - ph
    if x < 0:
        x = 0
    if x > max_x:
        x = max_x
    if y < 0:
        y = 0
    if y > max_y:
        y = max_y
    return x,y


while running:    
    player.x, player.y = handleInputs(player.x,player.y)

    
    pygame.display.set_caption(f"Use WASD or Arrow Keys to Move, Spacebar to slow down (toggle): {level}")
    screen.fill(BLACK)
    # draw the player sprite (embedded PNG)
    screen.blit(player_image, player)    
    
    
    
    pygame.display.flip()
    clock.tick(FPS)

pygame.quit()




